import React,{Component} from 'react';

class List extends Component{
    render(){
        return (
            <ListItem>
                <ListInfo>
                    <h3>超爽口的下饭神器，要不要来一罐？</h3>
                    <p></p>
                </ListInfo>

            </ListItem>
        )
    }
}

export default List;
